const employee = () => {
    const employee  = [
        {
            name : "Miroj",
            position: "CEO"
        },
        {
            name : "Manjila",
            position : "Accountant"
        },
        {
            name : "Asmita",
            position : "Manager"
        }
    ];

    return(
        <div className = "employee">
            {
            employee.map((employee) => ( 
            <div>
            <h1>{employee.name}</h1>
            <h5>{employee.position}</h5>
            </div>))
            }
        </div>
    );

};
export default employee;
